import React, { useState } from "react";
import styled from "styled-components";
import fastFood from "./fastFood";
import {
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams,
} from "react-router-dom";
import Foods from "./Foods";
const Sc_div = styled.div`
  max-width: 800px;
  display: block;
  margin: 0 auto;
  padding: 1rem 1rem;
`;
const Sc_header = styled.header`
  height: 100px;
  display: flex;
`;

const App = () => {
  const [data, setData] = useState(fastFood);
  console.log(data);
  return (
    <Sc_div>
      <Sc_header>
        <img src="https://saffroncateringonline.co.uk/wp-content/uploads/2020/05/LogoSaffron.png" />
        <Link to="/order">Order Pizza</Link>
      </Sc_header>
      <Foods data={data} />
    </Sc_div>
  );
};
export default App;
